from collections import Counter

# Complete the countTriplets function below.
def countTriplets(arr, r):
    if len(arr) < 3:
        return 0
    counter_arr = Counter(arr)
    second_counter = Counter()
    counter = 0
    for num in arr:

            prev_num = num//r
            next_num = num*r
            counter_arr[num] -=1
            if not num%r:
                counter += second_counter[prev_num]*counter_arr[next_num]

            second_counter[num] += 1
    return counter

